import React, { useState } from 'react';
import Container from './components/Container/Container';
import IntroPage from './components/gameScreen/introPage/IntroPage';


function App() {
  const [currentScreen, setCurrentScreen] = useState(<IntroPage />);


  const setGameScreen = (component) => {
    setCurrentScreen(component);

  };
  return (
    <Container gameScreen={currentScreen} setGameScreen={setGameScreen} />
  );
}

export default App;
